def test_mesh_lens_correction(render, example_tform_dict, tmpdir_factory):
    outdir = str(tmpdir_factory.mktemp("mesh_lens"))
    out_html_dir = outdir
    example['render'] = render_params
    example['metafile'] = os.path.join(TEST_DATA_ROOT, 
                                       "em_modules_test_data", 
                                       "mesh_lens_correction", 
                                       "mesh_lens_metafile.json")
    example['output_dir'] = outdir
    example['out_html_dir'] = out_html_dir
    example['z_index'] = 100

    mod = MeshLensCorrection(input_data=example, args=['--output_json', 'mesh_lens_out.json'])
    mod.run()
    
    with open('mesh_lens_out.json', 'r') as f:
        js = json.load(f)

    with open(js['output_json'], 'r') as f:
        new_tform_dict = json.load(f)

    with open(js['qc_json'], 'r') as f:
        qc = json.load(f)

    assert(not qc['hole_sections'] and not qc['gap_sections'])

    #example_tform = renderapi.transform.ThinPlateSplineTransform(dataString=example_tform_dict['dataString'])
    #new_tform = renderapi.transform.ThinPlateSplineTransform(dataString=new_tform_dict['dataString'])

    assert(new_tform_dict['className'] == "mpicbg.trakem2.transform.ThinPlateSplineTransform")

    # run again for code coverage
    mod.run()

    # more code coverage due to dumbness of the code coverage software not detecting parallel processes
    
    generate_point_matches(mod.render, 
                           mod.args['pairJson'], 
                           mod.args['input_stack'],
                           mod.args['match_collection'],
                           mod.args['matchMax'])

    
    